import Header from "./components/UI/Header";
import Slider from "./components/UI/Slider";

const App = () => {
  const categories = [
    "პოლიტიკა",
    "საზოგადოება",
    "სამართალი",
    "ბიზნესი & ეკონომიკა",
    "ეკონომიკა",
    "რელიგია",
  ];

  return (
    <div>
      <Header
        className="header"
        companyName="Company Name "
        categories={categories}
      />
      <Slider />
      {/* Other components */}
    </div>
  );
};

export default App;
